def solution(stdin: str) -> str:
    """O(n^3)"""
    n = int(stdin.readline())
    numbers = list(map(int, stdin.readline().split()))
    combinations = []

    def palindrome(matrix: List[List[int]]) -> bool:
        """Проверяет палиндром"""
        matrix = list(zip(*matrix))
        matrix_str = [''.join(map(str, m)) for m in matrix]
        return all([m == m[::-1] for m in matrix_str])

    def generate(numbers: List[int], index: int, matrix: List[List[int]], depth: int, max_depth: int) -> None:
        """Генерирует список перестановок"""
        if depth == max_depth:
            if palindrome(matrix):
                combinations.append(matrix)
            return

        for i in range(index, len(numbers)):
            if i not in matrix[depth]:
                matrix[depth].append(i)
                generate(numbers, i + 1, matrix, depth + 1, max_depth)
                matrix[depth].pop()

    generate(numbers, 0, [[] for _ in range(n)], 0, n)
    return 'YES\n' + '\n'.join(
       ''.join(map(str, m)) for m in combinations[0]
    ) if combinations else 'NO'


