    '''
    >>> solution('(((())')
    3
    >>> solution('()()()')
    0
    '''
    bracket_count = 0
    stack = []
    for bracket in stdin:
        if bracket == '(':
            bracket_count += 1
            stack.append(bracket_count)
        elif bracket == ')':
            bracket_count -= 1
            if bracket_count < 0:
                return 0
            if len(stack) > 0:
                top = stack.pop()
                if top!= bracket_count:
                    return 0
    if len(stack) > 0:
        return 0
    return len(stack)

